import React from 'react';
import Heatmap from './heat-map'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faSearch } from '@fortawesome/free-solid-svg-icons'
import { faGear } from '@fortawesome/free-solid-svg-icons'


class Header extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            isLoaded: false,
        };
    }

    //When someone types into the search bar a function will be called.
    //I want it to perform a fuzzy search on an object, to see if the string in the search bar matches any of the names in the object.
    //If it does, then it will return the object that matches the string.
    //If it doesn't, then it will return an empty object.
    //The returned object will be used to populate a table. That will be displayed under the search bar.

    componentDidMount() {
        this.setState({ isLoaded: true });
    }

    componentDidUpdate(prevProps) {
        if (this.props.id !== prevProps.id) {
            this.setState({ id: this.props.id });
        }
    }

    render() {
        return (
            <div className="header">
                <header className="main-header nav nav-dark">
                    <div className='navAnchors'>
                    <a className={this.props.mode + " header_anchor"} href="/">EveSubsystemAnalytics <span className='version_span gray'>(V. 1.0.0)</span></a>
                    <a className={this.props.mode + " header_anchor"} href="/about/">About</a>
                    </div>
                    <div className={this.props.mode + " input_addornments"}>
                        <input className={this.props.mode + " header_search"} type="text" placeholder="Search... " />
                        <FontAwesomeIcon icon={faSearch} />
                    </div>
                </header>
            </div>
        )
    }

}

export default Header;
